import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsx mdx */
import LayoutMDX from '@components/layout/LayoutMDX'


const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <LayoutMDX title="Your Awesome App" className="container py-8 max-w-xl" mdxType="LayoutMDX">
      <h1>{`header 1`}</h1>
      <h2>{`header 2`}</h2>
      <h3>{`header 3`}</h3>
      <h4>{`header 4`}</h4>
      <h5>{`header 5`}</h5>
      <h6>{`header 6`}</h6>
      <p>{`Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad`}</p>
      <sub>Small text</sub>
      <p><strong parentName="p">{`bold`}</strong></p>
      <ul>
        <li parentName="ul">{`item 1`}</li>
        <li parentName="ul">{`item 2`}</li>
        <li parentName="ul">{`item 3`}</li>
      </ul>
      <ol>
        <li parentName="ol">{`first`}</li>
        <li parentName="ol">{`second`}</li>
      </ol>
    </LayoutMDX>
    </MDXLayout>;
}

;
